import React, { useEffect, useState } from 'react'
import { useSelector, useDispatch } from 'react-redux'

import axios from 'axios'
import { Context } from '../pages/Store'

const Blog = () => {
  const dispatch = useDispatch()

  useEffect(() => {
    axios
      .get('https://ws.med.tn/web/doctorInfos/?api_key=drmateri')
      .then(response => {
        dispatch({
          type: 'SET_POSTS',
          payload: Object.values(response)[0],
        })
      })
      .catch(error => {
        dispatch({ type: 'SET_ERROR', payload: error })
      })
  }, [])
  const counter = useSelector(state => state != undefined && state.posts)
  const error = useSelector(state => state != undefined && state.error)

  console.log('*********', error)

  console.log(
    'state.counter',
    counter && counter[0].id_doctor != undefined && counter[0].id_doctor
  )
  return (
    <div>
      {counter && counter[0].id_doctor != undefined
        ? counter[0].id_doctor
        : null}
    </div>
  )
}

export default Blog
